// Session ... Session
type Session struct {
	conn *Connection
	//db   *gorm.DB
	uid uint
}

// ProxyExists ...
func (sess *Session) ProxyExist(reader *packet.Reader) {
	fmt.Println("ProxyExists")
	w := packet.CreateWriter(1)
	w.HexString("00")
	w.Send(sess.conn)
}

// Answer ...
func (sess *Session) Answer(reader *packet.Reader) {
	w := packet.CreateWriter(2)
	w.HexString("")
	w.Send(sess.conn)
}
